#include <fstream>
#include <bitset>

int main() {
    std::ifstream fin("cod.in");
    std::ofstream fout("cod.out");

    const int MAX_NUMS = 100;
    std::bitset<MAX_NUMS> counts; // All bits are initially set to false
    int n, num;

    fin >> n;
    for(int i = 0; i < n; ++i) {
        fin >> num;
        counts.flip(num); // Flip the bit corresponding to the number
    }

    for (int i = 0; i < MAX_NUMS; ++i) {
        if (counts[i]) {
            fout << i;
        }
    }

    fin.close();
    fout.close();

    return 0;
}
